= Design =
The application will be divided in :
* **xwiki-contrib-mail** (jar) : provides APIs in charge of: ** connection and connection check to email servers ** configurable dumping of emails from email servers ** methods to parse email headers and/or bodies ** methods to persist emails in a local store * **xwiki-contrib-mailarchive-api** (jar) : in charge of ** loading and parsing emails from configured servers (using xwiki-component-mail) ** persisting them in wiki pages/objects ** managing categories (mailing-lists, mail types) ** threading mails from the archive or from a specific topic * **xwiki-contrib-mailarchive-ui** (xar) : all the UI bits to administrate / configure / operate / consult the mail archive
Note: xwiki-contrib-mail should be unaware of XWiki so it can be used as a generic component.
The whole application UI is splitted in 4 spaces :
* MailArchiveCode : all utility pages / macros / classes * MailArchivePrefs : all preferences objects are stored in this space. This allows to easily reimport the application without overwritting existing preferences, or reset prefs at once. * MailArchiveItems : all mail and topic objects are stored in this space. * MailArchive : all entry pages presented to user (mainly MailArchive.WebHome as main entry point, + administration pages, + statistics, ...)
Items can be : - Simple mails (MailArchiveCode.MailClass) - Topics (used to group emails of a topic, MailArchiveCode.MailTopicClass) - Attached emails (MailArchiveCode.MailClass with a different value for type)
**xwiki-contrib-mail**
Script service:
{{code}} List<Message> fetch(String hostname, int port, String protocol, String folder, String username, String password, Properties additionalProperties, boolean onlyUnread); int check(String hostname, int port, String protocol, String folder, String username, String password, Properties additionalProperties, boolean onlyUnread); String parseAddressHeader(String header); {{/code}}
