**xwiki-contrib-mailarchive-api**
Script service:
{{code}} LoadingSession session(); LoadingSession session(final String serverPrefsDoc); int check(String serverPrefsDoc); int load(LoadingSession session); ArrayList<ThreadMessageBean> thread(tring topicid); ArrayList<ThreadMessageBean> thread(); IMAUser parseUser(String internetAddress); String getTimelineFeed(); DecodedMailContent getDecodedMailText(String mailPage, boolean cut); {{/code}}
The ThreadedMessageBean is essentially :
{{code}} class ThreadedMessageBean {
int level; String subject; String date; String user; ... other relevant message fields for display } {{/code}}
The general algorithm of a mails loading session :
* For each mails with unread flag ** Parse the mail headers ** Try to link new mail with existing topic *** If no topic exists, create a new one from class MailArchiveCode.MailTopicClass *** If topic already exists, update it (lastupdatedate and author field as needed) *** If topic already exists but subjects are too different, create a new one ** If this mail already exists, update it (try to relate it to an existing topic) ** If mail does not already exist, create new mail from class MailArchiveCode.MailClass
In addition, each included email (content type "message/rfc822") is also loaded in the archive, except that in this case it's not linked to a topic but to the email container. If a mail is attached to several mails, it is loaded only once.
Note: we consider "Message-ID" to really be unique, as defined by proper RFCs, so if there are different messages with same Message-ID value, only the first one encountered will be loaded.
Note : the threading algorithm is not implemented at loading time, only attachment to a topic is done at this time, and needed headers (reply-id, topic-id, references ...) are stored along other mail information. The threading algorithm is implemented in the Sheet that displays a Topic (MailArchiveCode.MailTopicSheet), and is essentially an implementation (with very little changes) of the [[Grendel app algorithm>>http://www.jwz.org/doc/threading.html]], which is MPL licensed. This algorithm is far more robust as it also takes into account the References header, which most of the time is your last chance to relate mails together ... The output of the threading is a tree structure that is flatten, so it can be managed from velocity templates easily.
Alternative algorithm that I might implement :
* thread the whole archive and keep the root nodes in a list * load and parse mails from the server * persist all mails in wiki pages (not topics) * thread the whole archive and extract the root nodes * compare the new state of the archive with the previous state : ** For new topics : create the topics wiki page/object ** For topics that disappeared : remove the topics wiki page ** For topics for which new mails were loaded : update the topic wiki page/object The problem to solve is that both threading algorithms do not make the same assumptions for now and so would not lead to exactly the same list of topics ... Other argument: current algorithm works pretty well so it might not be needed to rework that.
What is stored for a mail : - main identification and informative headers (msg-id, reply-id, topic-id, references, subject ...) - body in text format - body in html format (zipped) - attachments (as page attachments) : all files, images, ... - attached emails (stored as other mails, but without Topic)
{{info}} Improvements to be done: - parse not only text/html alternates but the full body parts, manage appropriately multipart/* content types - parse calendar parts {{/info}}
**Reply Feature** The need is to connect to an outgoing SMTP server. We will use the one configured in XWiki Preferences.
Other properties might/will be used: * SMTP Username: will retrieve values in this order of priority: property from MailArchiveCode.UserClass for logged user, user ID from logged user XWiki profile, property from XWikiPreferences * "From" address: will retrieve values in this order of priority: property from MailArchiveCode.UserClass for logged user, user email from logged user XWiki profile, admin email from XWikiPreferences * SMTP password: interactively entered by logged user after click on "Reply" button
Note: Mail Archive will be able (as an option) to match wiki profiles using "From" email address against XWiki profile "email" property value. If a MailArchiveCode.UserClass exists for a profile and has a matching email address, it will be used in priority (rework parseUser()). Note2: MailArchiveCode.UserClass object will be added to XWiki user profile.
Open question: we could imagine differentiating "From" email address (and/or SMTP username) depending on targeted Mailing-List, if user registered to different mailing-lists using different emails, but this leads to many use-cases (sending to multiple lists, ...), so have to think about it more.
= Progress =
* checkMails() method moved to Java component with scriptservice * loadMails(maxNb) implementation is done but might be rewritten soon (see alternate algo above) * Topics table-view has been rewritten to use a livetable instead of html sorted table * Now take into account references field for threading and at loading time to attach to a topic - now it can thread gmail messages ! * wiki pages (mails / topics) creation code * threading algorithm rewritten * test the threading/loading algorithms with a gmail server (some manual tests done) * removed some obsolete dependencies : mktree, section/column macros replaced by container macro * rewritten parsing of mail content and moved it to xwiki-contrib-mail. Now all elements (text/html/attachments) are loaded in 1 pass. To be tested.
